import FadeInSection from "./FadeInSection";

function About() {
    return (
        <div className="about">
            <div className="container-info">
                <FadeInSection>
                    <div className="dummy">hello</div>
                </FadeInSection>
            </div>
        </div>
    );
}

export default About;
